INSERT INTO `main_products` VALUES (1,'Counter-Strike: Global Offensive','Counter-Strike: Global Offensive (CS: GO) expands upon the team-based action gameplay that it pioneered when it was launched 19 years ago.\r\nCS: GO features new maps, characters, weapons, and game modes, and delivers updated versions of the classic CS content (de_dust2, etc.).\r\n\"Counter-Strike took the gaming industry by surprise when the unlikely MOD became the most played online PC action game in the world almost immediately after its release in August 1999,\" said Doug Lombardi at Valve. \"For the past 12 years, it has continued to be one of the most-played games in the world, headline competitive gaming tournaments and selling over 25 million units worldwide across the franchise.',100,280.00,2012,'2022-05-06 10:53:51','2022-06-15 15:03:06','ACTIVE',2,7,33),(3,'PUBG: BATTLEGROUNDS','LAND, LOOT, SURVIVE!\r\nPlay PUBG: BATTLEGROUNDS for free.\r\nLand on strategic locations, loot weapons and supplies, and survive to become the last team standing across various, diverse Battlegrounds.\r\nSquad up and join the Battlegrounds for the original Battle Royale experience that only PUBG: BATTLEGROUNDS can offer.\r\n\r\nThis content download will also provide access to the BATTLEGROUNDS Test Server, which requires a separate download to play. \r\nOptional in-game purchases available.',0,200.00,2017,'2022-05-06 10:55:35','2022-06-13 13:38:00','NOT_ACTIVE',1,11,34),(4,'Gotham Knights','Batman is dead. A new expansive, criminal underworld has swept the streets of Gotham City. It is now up to the Batman Family - Batgirl, Nightwing, Red Hood, and Robin - to protect Gotham, bring hope to its citizens, discipline to its cops, and fear to its criminals.\r\nFrom solving mysteries that connect the darkest chapters in the cityâ€™s history to defeating notorious villains in epic confrontations.',98,300.00,2022,'2022-05-06 14:55:13','2022-06-10 15:58:54','ACTIVE',1,11,35),(7,'BioShock Remastered','Explore the undersea city of Rapture, a haven for society\'s greatest minds that has devolved into a dystopian nightmare wrought by one man\'s hubris. Amidst the waterlogged ruins, a new ecosystem has emerged, where deranged Splicers hunt down the Little Sisters who would be helpless without their hulking Big Daddy guardians. Your only hopes for survival are quick thinking, reclaimed weaponry, and superhuman powers granted by DNA-altering Plasmids. To defeat Rapture\'s mutated monsters, you must become one.',341,50.55,2016,'2022-05-06 15:04:02','2022-06-10 17:59:08','ACTIVE',1,11,36),(8,'LEAP Mod Editor','LEAP is a fast-paced, multiplayer first-person shooter featuring epic battles with up to 60 players, each armed to the teeth. Use the mod editor to create maps, modify the game\'s balance or create new game\'s entirely within LEAP\'s ecosystem.\r\nLEAP is a fast-paced, multiplayer first-person shooter featuring epic battles with up to 60 players, each armed to the teeth.',62,280.00,2022,'2022-05-07 15:42:09','2022-06-13 13:38:00','ACTIVE',2,5,37),(9,'Warframe','Confront warring factions throughout a sprawling interplanetary system as you follow the guidance of the mysterious Lotus and level up your Warframe, build an Arsenal of destructive firepower, and realize your true potential across massive open worlds in this thrilling, genre-defining third-person combat experience.',187,350.55,2013,'2022-05-07 15:43:09','2022-06-15 15:04:13','ACTIVE',1,14,38),(10,'World of Tanks Blitz','Jump into a free-to-play MMO action shooter featuring a huge roster of over 300 massive tanks, stunning graphics, and intuitive touch-screen controls. Take on short, action-packed 7-vs-7 tank battles where real and alternate histories collide-no matter where you are!\r\nWorld of Tanks Blitz is built specifically for optimal online mobile gameplay and is currently available on your iPhone, iPad and iPod Touch.\"A lot of tanks, a lot of people and a lot of fun.\"\r\n- IGN',990,66.00,2016,'2022-05-07 15:45:59','2022-06-10 16:25:11','ACTIVE',1,15,40),(12,'SMITEÂ®','Join 35+ million players in SMITE, the worldâ€™s most popular action multiplayer online battle arena. Become a legend of myth, enter the Battleground of the Gods, and play FREE now!Unleash each deityâ€™s unique strategies, legendary weapons, and earth-shattering powers. Rain lightning down upon your foes as Zeus, assassinate from the shadows as Loki, or transform and trick your foes as the Monkey King, Sun Wukong. Which God will you choose?',100,130.00,2015,'2022-05-09 17:38:43','2022-06-10 16:29:46','ACTIVE',1,11,41),(14,'Brawlhalla','An epic platform fighter for up to 8 players online or local. Try casual free-for-alls, ranked matches, or invite friends to a private room. And it\'s free! Play cross-platform with millions of players on PlayStation, Xbox, Nintendo Switch, iOS, Android & Steam! Frequent updates. Over fifty Legends.',174,299.00,2017,'2022-06-10 17:19:23','2022-06-10 17:20:56','ACTIVE',2,1,46),(15,'Pro Cycling Manager 2022','Pro Cycling Manager 2022 makes you a sport director. Make all the decisions necessary to take your team to the top: your responsibilities include recruitment, planning objectives and race programmes, sponsor management, scouting future talent, training, race strategy and much more. Recruitment, budget, strategy: you make all the decisions. Explore the new system for detecting young potential, new options for customising your experience, a peloton that is more aggressive and much more',76,400.00,2022,'2022-06-10 17:24:21','2022-06-10 17:57:59','ACTIVE',1,3,47),(16,'WWE 2K22','REDESIGNED ENGINE. NEW CONTROLS. ALL THE FEATURES YOU CAN HANDLE. Get ripped out of the stands and hit with complete control of the WWE Universe. Hitting this hard has never been so easy. WWE 2K22: IT HITS DIFFERENT. Hitting this hard has never been so easy. Everything from the controls to the stunning graphics has been redesigned, and feels as real as being ringside at WrestleMania.',369,100.50,2022,'2022-06-10 17:28:58','2022-06-10 17:28:58','ACTIVE',2,11,48);
